package com.student.model;import java.io.Serializable;public class Student implements Serializable { private static final long serialVersionUID = 1L; private String firstName; private String lastName; private String year; private String department; private String address; private String contact; private String email; public String getFirstName() { return firstName; } public void setFirstName(String firstName) { this.firstName = firstName; } public String getLastName() { return lastName; } public void setLastName(String lastName) { this.lastName = lastName; } public String getYear() { return year; } public void setYear(String year) { this.year = year; } public String getDepartment() { return department; } public void setDepartment(String department) { this.department = department; } public String getAddress() { return address; } public void setAddress(String address) { this.address = address; } public String getContact() { return contact; } public void setContact(String contact) { this.contact = contact; } public String getEmail() { return email; } public void setEmail(String email) { this.email = email; }} 